import React, { useState } from "react";
import 'bootstrap/dist/css/bootstrap.min.css';
import '.';
import NavBar from "./component/NavBar/NavBar";
import Masthead from "./component/Masthead/Masthead";
import PortfolioSection from "./component/Portfolio/PortfolioSection";
import Footer from "./component/Footer/Footer";

function App() {
  const [emulationStatus, setEmulationStatus] = useState("");
  const [selectedArch, setSelectedArch] = useState("x86_64");

  const handleEmulate = () => {
    fetch(`http://localhost:5000/emulate/${selectedArch}`)
      .then(response => response.text())
      .then(data => {
        console.log(data);
        setEmulationStatus(data);
      })
      .catch(error => {
        console.error('Error:', error);
        setEmulationStatus('Error al iniciar la emulaci贸n');
      });
  };

  const handleStop = () => {
    fetch('http://localhost:5000/stop')
      .then(response => response.text())
      .then(data => {
        console.log(data);
        setEmulationStatus(data);
      })
      .catch(error => {
        console.error('Error:', error);
        setEmulationStatus('Error al detener la emulaci贸n');
      });
  };

  return (
    <>
    <div>
      <header>
        <NavBar />
        <Masthead />
        <PortfolioSection />
      </header>
    </div>
    <Footer />
    </>
  );
}

export default App;
